import { createApp } from "vue";
import VueRouter from "vue-router";
import App from "./App.vue";
import Login from "./Login.vue";
createApp.use(VueRouter);
const routes = [
  { path: "/login", Login },
  { path: "/", App },
];
const router = new VueRouter({
  routes,
});
new createApp({
  router,
  render: (h) => h(App),
}).$mount("#app");
